import './App.css';
import Footer from './Footer';
import { BrowserRouter as Router , Route, Routes} from 'react-router-dom';
import ScrollingText from './Scrolling';
function App() {
  return (
    <div className="App">
    <Router>
      <Routes>
        <Route path='/' element={<Footer></Footer>}></Route>
      </Routes>
    </Router>
    </div>
  );
}

export default App;
